-- ----------------------------
-- Records of video_info
-- ----------------------------
INSERT INTO `video_info` VALUES (650698895265792, '进击的巨人第一季', '热血', '日本', 25, '曾几何时，世界上突然出现无数身形庞大的巨人，普通人类的生命受到前所未有的威胁。为了保护自身安全，最后的人类筑起三座高墙：玛莉亚、露丝和希娜。人类迎来了长达一个世纪的和平岁月，却也让自己成为圈养在笼中的鸟儿，屈辱地失去自由。845年，高达60米的超大型巨人和铠之巨人登场， 摧毁了最外层的玛莉亚之壁，也惊醒了人类似乎永远不会苏醒的长梦。在此事件中，不愿蜷缩在墙内的少年艾伦·耶格尔（梶裕贵 配音）亲眼目睹母亲遇害，由此更坚定了他加入调查兵团的决心。', 3, 'https://gss0.bdstatic.com/94o3dSag_xI4khGkpoWK1HF6hhy/baike/c0%3Dbaike272%2C5%2C5%2C272%2C90/sign=c45e958815d8bc3ed2050e98e3e2cd7b/738b4710b912c8fc6b11d67ff0039245d78821a5.jpg', '2019-05-16 21:30:49', '2019-05-16 21:30:49');
INSERT INTO `video_info` VALUES (652546334134272, '黑色五叶草', '热血，青春', '日本', 100, '黑色五叶草》是田畠裕基在《少年jump》连载的杂志漫画 ，曾经险些遭到魔神毁灭的世界，拯救它的是一位被后世称为“魔法帝”的魔导士……两位被遗弃在教堂的少年，一位是有卓越魔力跟魔法才能的四叶草魔导书的尤诺，另一位魔法值为零但却意外获得黑色五叶草的魔法书的亚斯塔……', 2, 'https://gss3.bdstatic.com/7Po3dSag_xI4khGkpoWK1HF6hhy/baike/c0%3Dbaike92%2C5%2C5%2C92%2C30/sign=562016418e8ba61ecbe3c07d205dfc6f/86d6277f9e2f0708cf2d3a8be524b899a901f215.jpg', '2019-05-17 01:25:44', '2019-05-17 01:25:44');

